function App() {
  const BookList = () => {
    return (
      <section>
        <Book />
      </section>
    );
  };
  const Book = () => {
    return (
      <article>
        <Image />
        <Title />
        <Author />
      </article>
    );
  };
  const Image = () => {
    <img
      src="https://images-eu.ssl-images-amazon.com/images/I/71g2ednj0JL._AC_UL600_SR600,400_.jpg"
      alt="The Psychology of Money "
    />;
  };
  const Title = () => {
    <h2>The Psychology of Money </h2>;
  };
  const Author = () => {
    <h2>Morgan Housel</h2>;
  };
}

export default App;
